{
  "appId": "com.electron.muffon",
  "copyright": "Copyright © 2020-2024 Aleksey Shpakovsky",
  "win": {
    "icon": "build/icons/icon.ico",
    "target": [
      "nsis",
      "portable"
    ],
    "verifyUpdateCodeSignature": false
  },
  "mac": {
    "category": "public.app-category.music",
    "icon": "build/icons/icon.icns",
    "target": [
      "dmg",
      "pkg"
    ]
  },
  "linux": {
    "category": "AudioVideo",
    "icon": "build/icons/icon.icns",
    "target": [
      "AppImage",
      "deb",
      "flatpak",
      "pacman",
      "rpm"
    ],
    "desktop": {
      "Actions": "about;",
      "Categories": "AudioVideo",
      "Comment": "Advanced multi-source music streaming + discovery client",
      "MimeType": "x-scheme-handler/muffon;",
      "\n\n[Desktop Action about]\nName=About\nExec": "/opt/muffon/muffon --open-about-window\n\n"
    }
  },
  "artifactName": "${productName}-${version}-${os}-${arch}.${ext}",
  "compression": "ultra",
  "nsis": {
    "allowToChangeInstallationDirectory": true,
    "deleteAppDataOnUninstall": true,
    "oneClick": false,
    "perMachine": true,
    "installerSidebar": "./build/installerSidebar.bmp",
    "uninstallerSidebar": "./build/installerSidebar.bmp"
  },
  "flatpak": {
    "runtimeVersion": "23.08",
    "baseVersion": "23.08"
  },
  "portable": {
    "artifactName": "${productName}-${version}-${os}-${arch}-portable.${ext}"
  },
  "directories": {
    "buildResources": "build",
    "output": "build_electron"
  },
  "files": [
    "./.env",
    "./electron/**/*",
    "./index.html",
    {
      "from": "./build",
      "to": "./"
    }
  ],
  "protocols": [
    {
      "name": "muffon",
      "schemes": [
        "muffon"
      ],
      "role": "Viewer"
    }
  ]
}

import js from '@eslint/js'
import pluginVue from 'eslint-plugin-vue'
import {
  FlatCompat
} from '@eslint/eslintrc'
import {
  fixupConfigRules
} from '@eslint/compat'

export default [
  js.configs.recommended,
  ...pluginVue.configs[
    'flat/recommended'
  ],
  ...fixupConfigRules(
    new FlatCompat().config(
      {
        extends: [
          'standard'
        ]
      }
    )
  ),
  {
    ignores: [
      'build/',
      'build_electron/',
      'electron/plugins/i18n.js',
      'semantic/'
    ]
  },
  {
    languageOptions: {
      ecmaVersion: 'latest',
      sourceType: 'module'
    },
    files: [
      '**/*.js',
      '**/*.vue'
    ],
    rules: {
      'array-bracket-newline': [
        'error',
        {
          minItems: 1
        }
      ],
      'array-element-newline': [
        'error',
        {
          minItems: 1
        }
      ],
      'function-call-argument-newline': 'error',
      'function-paren-newline': [
        'error',
        {
          minItems: 1
        }
      ],
      'no-new': 'off',
      'no-undef': 'off',
      'object-curly-newline': [
        'error',
        {
          ObjectExpression: {
            minProperties: 1
          },
          ObjectPattern: 'always',
          ImportDeclaration: 'always'
        }
      ],
      'object-property-newline': [
        'error',
        {
          allowAllPropertiesOnSameLine: false
        }
      ],
      'vue/array-bracket-newline': [
        'error',
        {
          minItems: 1
        }
      ],
      'vue/custom-event-name-casing': [
        'error',
        'camelCase'
      ],
      'vue/key-spacing': 'error',
      'vue/match-component-file-name': [
        'error',
        {
          extensions: [
            'vue'
          ],
          shouldMatchCase: true
        }
      ],
      'vue/no-unused-properties': [
        'off',
        {
          groups: [
            'props',
            'data'
          ],
          deepData: true
        }
      ],
      'vue/no-v-html': 'off',
      'vue/object-curly-newline': [
        'error',
        {
          minProperties: 1
        }
      ],
      'vue/object-property-newline': [
        'error',
        {
          allowAllPropertiesOnSameLine: false
        }
      ],
      'vue/require-default-prop': 'off',
      'vue/v-on-event-hyphenation': [
        'error',
        'always'
      ]
    }
  },
  {
    files: [
      'electron/**/*',
      'vite.config.mjs'
    ],
    rules: {
      'no-undef': 'off'
    }
  }
]

